import Header from './Components/Header'
import Sidebar from './Components/Sidebar'

export default function HeaderAndSideBar({navBarState,setNavBarState,onClick,setOnClick}) {
    return (
        <>
            <Header navBarState={navBarState} setNavBarState={setNavBarState}/>
            <Sidebar navBarState={navBarState} onClick={onClick} setOnClick={setOnClick}/>
        </>
    )
}
